import React from "react";

function Appp(prop){
	
	return (
	
	<div className='container'>
	<div className='container_img'>
	<img src={prop.IS} />
	</div>
	<div className='container_detail'>
	<h1 className="hotel_name">{prop.HN}</h1>
	<h1 className="hotel_prize" >{prop.HP}</h1>
	</div>
	</div>
	
	)
}
export default Appp;
